import React from 'react';
import { Element } from 'react-scroll';
import { FaEnvelope, FaLinkedin, FaGithub } from 'react-icons/fa';

const Contact = () => {
  return (
    <Element name="contact">
      <section className="min-h-screen snap-start flex flex-col items-center bg-gradient-to-r from-blue-50 to-indigo-50 text-center px-4 py-16">
        <h2 className="text-4xl font-bold mb-6">Contact Me</h2>
        <p className="text-lg text-gray-700 mb-8">
          I'm always open to discussing new projects or opportunities. Feel free to reach out!
        </p>
        <div className="flex flex-col items-center space-y-4">
          <a href="mailto:vasudhamaddi114@gmail.com" className="flex items-center gap-2 text-blue-600 hover:underline">
            <FaEnvelope size={20} /> vasudhamaddi114@gmail.com
          </a>
          <div className="flex gap-6">
            <a href="https://www.linkedin.com/in/vasudha-maddi/" target="_blank" rel="noopener noreferrer" className="text-blue-600 hover:text-blue-800">
              <FaLinkedin size={28} />
            </a>
            <a href="https://github.com/VasudhaMaddi" target="_blank" rel="noopener noreferrer" className="text-gray-800 hover:text-gray-900">
              <FaGithub size={28} />
            </a>
          </div>
        </div>
      </section>
    </Element>
  );
};

export default Contact;
